import React from 'react';
import { BrowserRouter as Router, Routes } from "react-router-dom";
import ProtectedRoute from './components/ProtectedRoute'; // Import ProtectedRoute component
import Login from './pages/Login';
import DoctorLogin from './pages/DoctorLogin';
import PatientLogin from './pages/PatientLogin';
import Signup from './pages/Signup';
import AdminLogin from './pages/AdminLogin';
import AdminDashboard from './pages/Admin/AdminDashboard';
import AdminDoctor from './pages/Admin/AdminDoctor';
import AdminPatient from './pages/Admin/AdminPatient';
import PatientDashboard from './pages/Patient/Dashboard';
import PatientEditDetails from './pages/Patient/EditDetails';
import Aboutus from './pages/Aboutus';
import Contactus from './pages/Contactus';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/" element={<Login />} />
          <Route exact path="/doctorlogin" element={<DoctorLogin />} />
          <Route exact path="/patientlogin" element={<PatientLogin />} />
          <Route exact path="/aboutus" element={<Aboutus />} />
          <Route exact path="/contactus" element={<Contactus />} />
          <Route exact path="/signup" element={<Signup />} />
          <Route exact path="/adminlogin" element={<AdminLogin />} />
          <Route exact path="/admindashboard" element={<AdminDashboard />} />
          {/* Replace Route with ProtectedRoute for /patientdashboard */}
          <ProtectedRoute exact path="/patientdashboard" element={<PatientDashboard />} />
          {/* Replace Route with ProtectedRoute for /patienteditdetails */}
          <ProtectedRoute exact path="/patienteditdetails" element={<PatientEditDetails />} />
          <Route exact path="/admindoctor" element={<AdminDoctor />} />
          <Route exact path="/adminpatient" element={<AdminPatient />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
